import React, { Component } from 'react';
import { Router } from 'react-router-dom';
import { Link } from 'react-router-dom';

class App extends React.Component {

  render() {
    return (
      <div>
        <h1>App.js</h1>
			<Link to="/Login">Login</Link>

      </div>
    )
  }
}

export default App;
